        gallery: [],
        shared_links: [],
        page: '\n <div class="content-wrapper">\n <h1 id="mini-stari-projekat-pravljenja-elemenata-za-c%23-form-window" tabindex="-1">Mini stari projekat pravljenja elemenata za C# Form Window</h1>\n<p>XAML WPF editor je projekat koji je inicijalno bio zami\u0161ljen kao alat za testiranje elemenata i NuGet biblioteka. Kasnije,projekat je evoluirao u <strong>Eronelit SDK</strong>,koji se razvija od 2017. godine do danas,uz brojne izmene i unapre\u0111enja.</p>\n<p>Danas,<strong>Eronelit SDK</strong> podr\u017eava sve programske jezike,uklju\u010duju\u0107i razvoj za Android platformu. Trenutno se razvija i poseban programski jezik koji je temelj za <strong>serverski Eronelit OS</strong> i <strong>Echat</strong> .</p>\n<p><strong>Echat</strong> je po\u010deo kao jednostavan text/plain \u010det koji je komunicirao preko lokalne IPv4 adrese,ali je vremenom postao napredna dru\u0161tvena i poslovna mre\u017ea koja \u0107e biti uskoro dostupna...</p>\n<p>Eronelit SDK je kasnije integrisan u <strong>Eronelit OS</strong> . Plan je da <strong>Eronelit SDK Earth verzija</strong> bude dostupna svima,dok <strong>Solar verzija</strong> ne\u0107e biti besplatno dostupna.</p>\n<h3 id="za%C5%A1to-eronelit-sdk%3F" tabindex="-1">Za\u0161to Eronelit SDK?</h3>\n<p>Jedan od klju\u010dnih razloga je kori\u0161\u0107enje <strong>virtuelne akceleracije</strong>,za razliku od drugih sistema koji se oslanjaju na softversku ili hardversku akceleraciju. Ovo je jedna od inovativnih karakteristika koja \u010dini Eronelit SDK posebnim.</p>\n<p><strong>P.S.</strong> Eronelit OS uskoro...</p>\n<br> \n \n<video-player-v2 data-src="https://api.eronelit.com/app&id=A03429468246&blog=22_dec_2024_13_32/3925316816791" data-poster="https://api.eronelit.com/app&id=A03429468246&blog=22_dec_2024_13_32/392531681679100"></video-player-v2><br>\n<video-player-v2 data-src="https://api.eronelit.com/app&id=A03429468246&blog=22_dec_2024_13_32/3030492" data-poster="https://api.eronelit.com/app&id=A03429468246&blog=22_dec_2024_13_32/303049200"></video-player-v2>\n </div>\n\t\n <dnm_footer>Last modified:24.jul.2023 14:42AM</dnm_footer><style type=\'text/css\'>\n @import url(\'https://fonts.googleapis.com/css2?family=Mulish:ital,wght@0,200;0,300;0,400;0,500;0,600;0,700;0,800;0,900;1,200;1,300;1,400;1,500;1,600;1,700;1,800;1,900&display=swap\');\n @import url(\'https://fonts.googleapis.com/css2?family=Poppins:ital,wght@0,100;0,200;0,300;0,400;0,500;0,600;0,700;0,800;0,900;1,100;1,200;1,300;1,400;1,500;1,600;1,700;1,800;1,900&display=swap\');\n \n </style><script type=\'text/javascript\'> </script><div class="cursor " style="opacity:0;"></div>\n \n </div>',
