        page: "<!DOCTYPE html>\n<html>\n<head>\n<title>19_okt_2024_23_40.md</title>\n<meta http-equiv=\"Content-type\" content=\"text/html;charset=UTF-8\">\n \n</head>\n<body>\n <div class=\"content-wrapper\">\n <h1 id=\"dnevnik-%7C-%F0%9F%95%8A%F0%9F%A4%8D%E2%9C%A8\" tabindex=\"-1\">Dnevnik|\ud83d\udd4a\ud83e\udd0d\u2728</h1>\n<blockquote>\n<p>RS - Solarni dan 9714 / Ra\u010duna se po Zemaljskom vremenu<br>\nLokacija:Mati\u010dna planeta Drevnih pod imenom...</p>\n</blockquote>\n<p>\u0160o:... evo me. Aa? Dobro...</p>\n<p>&quot;Krenuo je u palatu iz Hangara,poklonio se i on svim Drevnima,jer kada je iza\u0161ao iz svemirskog broda koji ga je dovezao sa planete Zemlje,svi su mu se klanjali,ali nije znao za\u0161to? Samo je oti\u0161ao u palatu,bilo mu je \u010dudno,mislio je...&quot;</p>\n<p>Kapljica:\u0160o? Jesi li dobro? Ne ose\u0107a\u0161 ni\u0161ta?!</p>\n<p>\u0160o:Boli me glava zbog onoga sa Zemaljskom bolesti,ovaj zemaljski oblik zna\u0161? Ina\u010de,dobro sam. \u0160ta je?</p>\n<p>&quot;Htela je da ga udari jer joj se nije javljao,ali ga je samo zagrlila...&quot;</p>\n<p>\u0160o:Kapljice,za\u0161to su se svi Drevni koje sam video dok sam dolazio iz hangara u palatu kod tebe klanjali?!</p>\n<p>Kapljica:Opet ona svetla i pesme iz piramida na planeti. Sada su se \u010duli otkucaji srca. Zna\u0161 \u0161ta to zna\u010di?!</p>\n<p>\u0160o:... znam. Znam za to.</p>\n<p>&quot;Nije mu bilo svejedno... Pri\u010dali su o tome sat i 43 minute.&quot;</p>\n<p>\u0160o:Ali ja ne pripadam me\u0111u ljudima. Ne \u017eele me pored sebe. Zna\u0161 to?</p>\n<p>Kapljica:... znam. Navikao si da zaboravlja\u0161 Dnevnik kod mene u sobi,ostavljen \u0161irom otvoren,pa ga pro\u010ditam. Znam sve...</p>\n<p>&quot;Zagrlili su se. Pa su onda promenili temu...&quot;</p>\n<p>\u0160o:... Kapljice? Gde je ona tvoja slika?</p>\n<p>Kapljica:Koja slika? A,moja slika,hahaha. \u010cekaj.</p>\n<p>&quot;... Oti\u0161la je do police,izvadila sliku iz kutije i vratila je \u0160o-u.&quot;</p>\n<p>Kapljica:\u0160o,dao si mi je da je \u010duvam pre nego \u0161to si oti\u0161ao na planetu Zemlju,kao da si predosetio da \u0107e\u0161 \u017eiveti me\u0111u ljudima.</p>\n<p>\u0160o:Hahaha. Vidi kako si lepa na slici! Imala si 35 hiljada godina kada je nastala.</p>\n<p>Kapljica:Da,tada si me i upoznao. Brzo prolazi vreme. Leti vreme...</p>\n<p>\u0160o:... zanimljivo. Isto kao i kod Zemljana. Ju\u010de nisi ni znao za njih,danas si sa njima,sutra su samo obris tvojih se\u0107anja. Tada si imala belu kosu kao sneg. Nisi se ni malo promenila...</p>\n<p>&quot;Se\u0107anja? Ako su ti te osobe blizu srcu,mo\u017ee pro\u0107i na hiljade,na milione,na bilione godina. Se\u0107a\u0107e\u0161 se glasa,izgleda,o\u010diju. Za\u0161to se onda ka\u017ee da su ogledalo du\u0161e? Kakve to veze ima sa Zemljanima?...&quot;</p>\n<p>Savetnik:\u0160o,Viso\u010danstvo. Stigli su rezultati. Ne\u0107ete jo\u0161 dugo biti na planeti Zemlji. Vra\u0107ate se na na\u0161u mati\u010dnu planetu! Naravno,znate pravila!</p>\n<p>Kapljica:Mogao si da mu ka\u017ee\u0161 kasnije. Jedva sam ga smirila,sada se opet uzrujao.</p>\n<p>\u0160o:U redu je. Dobro sam,ne brini. Kapljice do\u0111i da te zagrlim...</p>\n<p>P.S. Ogledalo du\u0161e? Kakve veze ima sa Zemljanima onda? Jednostavno,jednostavno je,morate razumeti?...</p>\n<p>Ljubav.</p>\n<p><img src=\"https://api.eronelit.com/app&id=A03429468246&blog=19_okt_2024_23_40/1112073097\" alt=\"1112073097\"></p>\n<h1 id=\"diary-%7C-%F0%9F%95%8A%F0%9F%A4%8D%E2%9C%A8\" tabindex=\"-1\">Diary|\ud83d\udd4a\ud83e\udd0d\u2728</h1>\n<blockquote>\n<p>EN - Solar day 9714 / Based on Earth time<br>\nLocation:Home planet of the Ancients under the name...</p>\n</blockquote>\n<p>\u0160o:... here I am. Ah? Okay...</p>\n<p>&quot;He made his way to the palace from the Hangar,bowing to all the Ancients as well,because when he stepped out of the spaceship that brought him from the planet Earth,everyone bowed to him,but he didn't know why? He just went to the palace,feeling strange,he thought...&quot;</p>\n<p>Kapljica:\u0160o? Are you okay? You don't feel anything?!</p>\n<p>\u0160o:I have a headache because of the Earth illness,this Earthly form,you know? Otherwise,I'm fine. What's wrong?</p>\n<p>&quot;She wanted to hit him because he hadn't contacted her,but instead,she just hugged him...&quot;</p>\n<p>\u0160o:Kapljica,why did all the Ancients I saw while coming from the hangar to the palace bow to me?!</p>\n<p>Kapljica:Again,those lights and songs from the pyramids on the planet. Now,heartbeats could be heard. You know what that means?!</p>\n<p>\u0160o:... I know. I know about that.</p>\n<p>&quot;He didn't feel entirely at ease... They talked about it for an hour and 43 minutes.&quot;</p>\n<p>\u0160o:But I don't belong among humans. They don't want me by their side. You know that?</p>\n<p>Kapljica:... I know. You've gotten used to leaving your Journal in my room,wide open,and I read it. I know everything...</p>\n<p>&quot;They hugged. Then they changed the subject...&quot;</p>\n<p>\u0160o:... Kapljica? Where is that picture of yours?</p>\n<p>Kapljica:Which picture? Oh,my picture,hahaha. Wait.</p>\n<p>&quot;... She went to the shelf,took the picture out of the box,and handed it back to \u0160o.&quot;</p>\n<p>Kapljica:\u0160o,you gave it to me to keep before you left for Earth,as if you had a feeling you'd be living among humans.</p>\n<p>\u0160o:Hahaha. Look how beautiful you are in the picture! You were 35 thousand years old when it was taken.</p>\n<p>Kapljica:Yes,that's when you met me. Time flies quickly. Time flies...</p>\n<p>\u0160o:... interesting. Just like with humans. Yesterday,you didn't know about them,today you're with them,tomorrow they are just a trace in your memories. You had white hair like snow back then. You haven't changed a bit...</p>\n<p>&quot;Memories? If those people are close to your heart,thousands,millions,billions of years could pass. You will remember their voice,appearance,eyes. Why,then,do they say that the eyes are the mirror of the soul? What does that have to do with humans?...&quot;</p>\n<p>Advisor:\u0160o,Your Majesty. The results have arrived. You won't be on Earth much longer. You're returning to our home planet! Of course,you know the rules!</p>\n<p>Kapljica:You could've told him later. I barely calmed him down,and now he's upset again.</p>\n<p>\u0160o:It's okay. I'm fine,don't worry. Kapljica,come here,let me hug you...</p>\n<hr>\n<p>P.S. The mirror of the soul? What does it have to do with humans,then? Simply,it's simple,you have to understand?... Love.</p>\n<p>#book</p>\n\n </div>\n</body>\n</html>\n\n <dnm_footer>Last modified:19.okt.2024 23:40</dnm_footer><style type='text/css'>\n @import url('https://fonts.googleapis.com/css2?family=Mulish:ital,wght@0,200;0,300;0,400;0,500;0,600;0,700;0,800;0,900;1,200;1,300;1,400;1,500;1,600;1,700;1,800;1,900&display=swap');\n @import url('https://fonts.googleapis.com/css2?family=Poppins:ital,wght@0,100;0,200;0,300;0,400;0,500;0,600;0,700;0,800;0,900;1,100;1,200;1,300;1,400;1,500;1,600;1,700;1,800;1,900&display=swap');\n \n </style><script type='text/javascript'> </script><div class=\"cursor \" style=\"opacity:0;\"></div>\n \n </div>",
