        page: '<!DOCTYPE html>\n<html>\n<head>\n<title>18_okt_2024_13_40.md</title>\n<meta http-equiv="Content-type" content="text/html;charset=UTF-8">\n \n\n</head>\n<body>\n <div class="content-wrapper">\n <h1 id="dnevnik-%7C-svemirski-kafi%C4%87" tabindex="-1">Dnevnik|Svemirski kafi\u0107</h1>\n<blockquote>\n<p>RS - Solarni dan 9713 / Ra\u010duna se po Zemaljskom vremenu\nLokacija:Dysonova sfera Terranaca - Arzeon,Sektor 394,kvadrant F0495-V********</p>\n</blockquote>\n<p>Alss\'sea:&quot;Svi\u0111a ti se kafi\u0107 na Arzeonom Prstenu?&quot;</p>\n<p>&quot;Dysonova sfera,ure\u0111aj u \u010dijoj je sredini zvezda i koristi energiju za napajanje... Terranci su poznati po tome da prave Dysonove sfere \u0161irom galaksije. Ljudi sa Zemlje su potomci Terranaca,ali su Zemljani dosta propali zbog pohlepe,jurnjave za mo\u0107i i slavom...&quot;</p>\n<p>\u0160o:&quot;Aham. Super ste odradili vi Terranci sve. \u010cekaj,hahaha,da li su to obojili generator gravitacije u roze-ljubi\u010dastu boju?&quot;</p>\n<p>Alss\'sea:&quot;Da. Ahahaha... Daj mu ovo. \u0160o,sli\u010dno je kao kapu\u0107ino sa Zemlje,ima\u0161 u raznim bojama,ukusi su prirodno vo\u0107e,ni\u0161ta ve\u0161ta\u010dko,probaj.&quot;</p>\n<p>\u0160o:&quot;Hmm,predivno je. Kako si znala da volim ovo? Kako? Kapljica ti je rekla? Savetnik? Jao,preukusno je!!!&quot;</p>\n<p>&quot;Zapri\u010dali su se,pa su se smejali kad mu je rekla za\u0161to je generator ofarban u roze-ljubi\u010dasto. Kasnije su pri\u010dali jo\u0161 ne\u0161to...&quot;</p>\n<p>\u0160o:&quot;\u010cekaj,roze-ljubi\u010dasto samo da se osveti\u0161 glavnom in\u017eenjeru? Ahahaha,u\u010di\u0161. U\u010di\u0161!&quot;</p>\n<p>Alss\'sea:&quot;Plavo-ljubi\u010dasta boja dosta odbija radijaciju na toj leguri,i te\u0161ko je apsorbovati mnogo radijacije i elektrona,zna\u0161? Pa se morao pomu\u010diti zbog druge boje,a ne crne...&quot;</p>\n<p>\u0160o:&quot;Aha,sad shvatam,testira\u0161 ga?!&quot;</p>\n<p>In\u017eenjer za drugim stolom:&quot;Znam da me testira\u0161. Ja sam Terranac i \u010dast mi je slu\u017eiti na\u0161oj Terranskoj princezi.&quot;</p>\n<p>&quot;\u010culi su oboje \u0161ta je in\u017eenjer rekao,ali su se pravili da nisu.&quot;</p>\n<p>Alss\'sea:&quot;\u0160o,smanji kapu\u0107ino. Dobi\u0107e\u0161 \u0161e\u0107er! Ho\u0107e\u0161 da me slika\u0161?&quot;</p>\n<p>\u0160o:&quot;Aham...&quot;</p>\n<p>P.S. To je ona ista Dysonova sfera koju su nau\u010dnici sa Zemlje otkrili pre nekoliko godina...</p>\n<p><img src="https://api.eronelit.com/app&id=A03429468246&blog=18_okt_2024_13_40/1111542160" alt="1729257846692"></p>\n<h1 id="diary-%7C-space-caffe" tabindex="-1">Diary|Space Caffe</h1>\n<blockquote>\n<p>RS - Solar Day 9713 / Calculated by Earth Time\nLocation:Dyson Sphere of the Terrans - Arzeon,Sector 394,Quadrant F0495-V********</p>\n</blockquote>\n<p>Alss\'sea:&quot;Do you like the caf\u00e9 on the Arzeon Ring?&quot;</p>\n<p>&quot;A Dyson sphere,a device with a star at its center that harnesses energy... The Terrans are known for building Dyson spheres across the galaxy. The people of Earth are descendants of the Terrans,but Earthlings have deteriorated quite a bit due to greed,chasing after power and fame...&quot;</p>\n<p>\u0160o:&quot;Uh-huh. You Terrans really did a great job. Wait,hahaha,did they paint the gravity generator pink-purple?&quot;</p>\n<p>Alss\'sea:&quot;Yes. Ahahaha... Give him this. \u0160o,it\u2019s similar to cappuccino from Earth,available in different colors,the flavors are natural fruit,nothing artificial,try it.&quot;</p>\n<p>\u0160o:&quot;Hmm,it\'s wonderful. How did you know I love this? How? Did the Drop tell you? The advisor? Wow,it\u2019s so delicious!!!&quot;</p>\n<p>&quot;They got carried away talking and then laughed when she explained why the generator was painted pink-purple. Later,they talked about other things...&quot;</p>\n<p>\u0160o:&quot;Wait,pink-purple just to get back at the chief engineer? Ahahaha,you\'re learning. You\'re learning!&quot;</p>\n<p>Alss\'sea:&quot;The blue-purple color repels radiation quite well on that alloy,and it\u2019s difficult to absorb a lot of radiation and electrons,you know? So he had to struggle with another color,not black...&quot;</p>\n<p>\u0160o:&quot;Ah,now I get it,you\u2019re testing him?!&quot;</p>\n<p>Engineer at the other table:&quot;I know you\u2019re testing me. I\u2019m a Terran and it\u2019s an honor to serve her,our Terran princess.&quot;</p>\n<p>&quot;They both heard what the engineer said but pretended not to.&quot;</p>\n<p>Alss\'sea:&quot;\u0160o,ease up on the cappuccino. You\u2019ll get a sugar rush! Do you want to take a picture of me?&quot;</p>\n<p>\u0160o:&quot;Uh-huh...&quot;</p>\n<p>P.S. This is the same Dyson sphere that scientists from Earth discovered a few years ago...</p>\n<p>#book</p>\n\n </div>\n</body>\n</html>\n\n <dnm_footer>Last modified:18.okt.2024 13:40</dnm_footer><style type=\'text/css\'>\n @import url(\'https://fonts.googleapis.com/css2?family=Mulish:ital,wght@0,200;0,300;0,400;0,500;0,600;0,700;0,800;0,900;1,200;1,300;1,400;1,500;1,600;1,700;1,800;1,900&display=swap\');\n @import url(\'https://fonts.googleapis.com/css2?family=Poppins:ital,wght@0,100;0,200;0,300;0,400;0,500;0,600;0,700;0,800;0,900;1,100;1,200;1,300;1,400;1,500;1,600;1,700;1,800;1,900&display=swap\');\n \n </style><script type=\'text/javascript\'> </script><div class="cursor " style="opacity:0;"></div>\n \n </div>',
