        page: '<!DOCTYPE html>\n<html>\n<head>\n<title>17_okt_2024_13_07.md</title>\n<meta http-equiv="Content-type" content="text/html;charset=UTF-8">\n \n\n</head>\n<body>\n <div class="content-wrapper">\n <h1 id="dnevnik-%7C-duh-akela...-%F0%9F%90%BA%E2%9C%A8%F0%9F%AA%90%F0%9F%8C%95%F0%9F%9B%B8" tabindex="-1">Dnevnik|Duh Akela... \ud83d\udc3a\u2728\ud83e\ude90\ud83c\udf15\ud83d\udef8</h1>\n<blockquote>\n<p>RS - Solarni dan 9712 / Ra\u010duna se po Zemaljskom vremenu\nLokacija:Negde u Ju\u017enoj Americi... Indijansko pleme</p>\n</blockquote>\n<p>Poglavica:Akela,na\u0161 duh zavija ka mesecu,tamo na brdu?...</p>\n<p>\u0160aman:Vreme je,reci svima da se spakuju.</p>\n<p>Poglavica:\u0160ta se de\u0161ava?</p>\n<p>\u0160aman:... Na\u0161i preci su govorili o zlatnom vuku koji \u0107e zavijati nad belim mesecom,a to \u0107e ozna\u010diti dolazak kraja sveta...</p>\n<p>De\u010dak,\u010dlan plemena:Majko,gde idemo?</p>\n<p>Mama:Idemo u svet duhova,tamo odakle je do\u0161ao Akela. Na\u0161 duh \u010duvar. Vuk...</p>\n<p>\u0160erif,policajac koji je sve to posmatrao sa svojim kolegom pored kola. Kasnije se popeo na susedno brdo da bolje vidi \u0161ta se de\u0161ava,i pao je na kolena kada ga je duh Akela pogledao. Skinuo je \u0161e\u0161ir...</p>\n<p>Njih dvoje su uspeli da se zagledaju kroz portal i videli su masivne gradove koje nisu mogli ni da zamisle u svojim snovima. Videli su tri zvezde. Znali su gde odlaze \u2013 na neki drugi svet,negde daleko,u nekoj dalekoj galaksiji...</p>\n<p>P.S. Duh? Samo duh?...\n... Iznad portala videle su se tri sfere koje su kru\u017eile u dobro poznatom obliku trougla.</p>\n<p><img src="https://api.eronelit.com/app&id=A03429468246&blog=17_okt_2024_13_07/1111177278" alt="1729163709215"></p>\n<hr>\n<h1 id="diary-%7C-spirit-akela-...-%F0%9F%90%BA%E2%9C%A8%F0%9F%AA%90%F0%9F%8C%95%F0%9F%9B%B8" tabindex="-1"><strong>Diary|Spirit Akela ... \ud83d\udc3a\u2728\ud83e\ude90\ud83c\udf15\ud83d\udef8</strong></h1>\n<blockquote>\n<p>EN - Solar day 9709 / Calculated by Earth time\nLocation:Somewhere in South America... Indigenous tribe</p>\n</blockquote>\n<p><strong>Chief:</strong> Akela,our spirit howls at the moon,up there on the hill?...</p>\n<p><strong>Shaman:</strong> It is time,tell everyone to pack.</p>\n<p><strong>Chief:</strong> What is happening?</p>\n<p><strong>Shaman:</strong> ... Our ancestors spoke of a golden wolf that would howl beneath the white moon,and that would signify the coming of the end of the world...</p>\n<p><strong>Boy,member of the tribe:</strong> Mother,where are we going?</p>\n<p><strong>Mother:</strong> We are going to the spirit world,where Akela came from. Our guardian spirit. The wolf...</p>\n<p><strong>Sheriff</strong>,a policeman who had been watching all of this with his colleague beside their car. Later,he climbed a nearby hill to get a better view of what was happening and fell to his knees when the spirit,Akela,looked at him. He took off his hat...</p>\n<p>The two of them managed to gaze through the portal and saw massive cities they could not have imagined even in their dreams. They saw three stars. They knew where they were going \u2013 to another world,somewhere far away,in some distant galaxy...</p>\n<p>P.S. A spirit? Just a spirit?...</p>\n<p>... Above the portal,three spheres were seen circling in the familiar shape of a triangle.</p>\n<p>#book</p>\n\n </div>\n</body>\n</html>\n\n <dnm_footer>Last modified:17.okt.2024 13:07</dnm_footer><style type=\'text/css\'>\n @import url(\'https://fonts.googleapis.com/css2?family=Mulish:ital,wght@0,200;0,300;0,400;0,500;0,600;0,700;0,800;0,900;1,200;1,300;1,400;1,500;1,600;1,700;1,800;1,900&display=swap\');\n @import url(\'https://fonts.googleapis.com/css2?family=Poppins:ital,wght@0,100;0,200;0,300;0,400;0,500;0,600;0,700;0,800;0,900;1,100;1,200;1,300;1,400;1,500;1,600;1,700;1,800;1,900&display=swap\');\n \n </style><script type=\'text/javascript\'> </script><div class="cursor " style="opacity:0;"></div>\n \n </div>',
