        page: '<!DOCTYPE html>\n<html>\n<head>\n<title>04_okt_2024_05_00.md</title>\n<meta http-equiv="Content-type" content="text/html;charset=UTF-8">\n \n\n</head>\n<body>\n <div class="content-wrapper">\n <h1 id="dnevnik-%7C-svemir-%F0%9F%AA%90%F0%9F%94%A5%F0%9F%95%8A%E2%9C%A8" tabindex="-1">Dnevnik|Svemir \ud83e\ude90\ud83d\udd25\ud83d\udd4a\u2728</h1>\n<blockquote>\n<p>RS - Solarni dan 9699 / Ra\u010duna se po Zemaljskom vremenu\nLokacija:Oriana,mati\u010dni svemirski brod Drevnih...</p>\n</blockquote>\n<p>&quot;Prvi posmatraju zvezdano no\u0107no more i pitaju se da li nekoga ima tamo?...\nDrugi sanjaju da napokon posete Svemir,rade celog \u017eivota da bi ostvarili svoj san,\u0161to je predivno...\n...dok \u0107u se ja jednog dana,vrlo,vrlo brzo,zauvek vratiti tamo... &quot;</p>\n<p>Kapljica:Super si napisao. Kada bi Zemljani shvatili ko si ti ustvari?\nI da uskoro odlazi\u0161 zbog tvoje Zemaljske bolesti. Znam sve,\u0160o...\n...Vidi kroz prozor? Poznata ti je ova planeta?</p>\n<p>\u0160o:Hmm? Pustinja? \u010cekaj. Vidi se galaksija Mle\u010dni put? Okej?</p>\n<p>&quot;Krenuo je da se smeje,ali nije mogao da se seti. Kao da mu ne\u0161to nije dalo...&quot;</p>\n<p>Kapljica:Aha? Povezuje\u0161? Haha...</p>\n<p>\u0160o:Ozbiljno? Aaa...</p>\n<p>&quot;Presre\u0107an je bio,grlio je Kapljicu od sre\u0107e...&quot;</p>\n<p>Kapetan:Spremite se za sletanje...</p>\n<p>Kapljica:...na\u0161a kula od kamenja,koju smo napravili pre nego \u0161to smo oti\u0161li sa planete,jo\u0161 je tamo na litici?</p>\n<p>\u0160o:...kao da je bilo ju\u010de. Haha...</p>\n<p>P.S. To je prva planeta koju su posetili njih dvoje,zajedno,pre 143.691 godinu...</p>\n<p><img src="https://api.eronelit.com/app&id=A03429468246&blog=04_okt_2024_05_00/4356136" alt="4356136"></p>\n<h1 id="%23-diary-%7C-space-%F0%9F%AA%90%F0%9F%94%A5%F0%9F%95%8A%E2%9C%A8" tabindex="-1"># Diary|Space \ud83e\ude90\ud83d\udd25\ud83d\udd4a\u2728</h1>\n<blockquote>\n<p>EN - Solar day 9699 / Based on Earth time\n<strong>Location</strong>:Oriana,the mothership of the Ancients...</p>\n</blockquote>\n<p>&quot;Some gaze at the starry night sea and wonder if anyone is out there?...\nOthers dream of finally visiting Space,working their whole lives to make their dream come true,which is beautiful...\n...while I,one day,very,very soon,will return there forever...&quot;</p>\n<p><strong>Kapljica</strong>:You wrote it beautifully. What if Earthlings realized who you really are?\nAnd that you\'re leaving soon because of your Earthly illness. I know everything,\u0160o...\n...Look through the window. Does this planet seem familiar?</p>\n<p>\u0160o:Hmm? A desert? Wait. I can see the Milky Way galaxy? Okay?</p>\n<p>&quot;He started laughing but couldn\'t remember. It was as if something was holding him back...&quot;</p>\n<p><strong>Kapljica</strong>:Aha? Making the connection? Haha...</p>\n<p>\u0160o:Seriously? Aaa...</p>\n<p>&quot;He was overjoyed,hugging Kapljica with happiness...&quot;</p>\n<p><strong>Captain</strong>:Prepare for landing...</p>\n<p><strong>Kapljica</strong>:...our stone tower,the one we built before we left the planet,is still there on the cliff?</p>\n<p>\u0160o:...it feels like it was just yesterday. Haha...</p>\n<br>\n<p><strong>P.S. This is the first planet they visited together,143,691 years ago...</strong></p>\n\n </div>\n</body>\n</html>\n\n <dnm_footer>Last modified:04.okt.2024 05:00</dnm_footer><style type=\'text/css\'>\n @import url(\'https://fonts.googleapis.com/css2?family=Mulish:ital,wght@0,200;0,300;0,400;0,500;0,600;0,700;0,800;0,900;1,200;1,300;1,400;1,500;1,600;1,700;1,800;1,900&display=swap\');\n @import url(\'https://fonts.googleapis.com/css2?family=Poppins:ital,wght@0,100;0,200;0,300;0,400;0,500;0,600;0,700;0,800;0,900;1,100;1,200;1,300;1,400;1,500;1,600;1,700;1,800;1,900&display=swap\');\n \n </style><script type=\'text/javascript\'> </script><div class="cursor " style="opacity:0;"></div>\n \n </div>',
