        thumbail:
          "https://api.eronelit.com/app&id=A03429468246&blog=02_okt_2024_19_30/362361367",
        category: ["book", "deviantart"],
        gallery: [],
        shared_links: [
          "aHR0cHM6Ly93d3cuZGV2aWFudGFydC5jb20vbWFya285ODI3L2FydC8xMTA1NDM0NjM1",
          "aHR0cHM6Ly93d3cuZGV2aWFudGFydC5jb20vbWFya285ODI3",
        ],
        page: '<!DOCTYPE html>\n<html>\n<head>\n<title>02_okt_2024_19_30.md</title>\n<meta http-equiv="Content-type" content="text/html;charset=UTF-8">\n \n</head>\n<body>\n <div class="content-wrapper">\n <h1 id="dnevnik-%7C-da-biste-stvorili%2C-morate-prvo-uni%C5%A1titi!-%E2%9A%A0%EF%B8%8F%E2%98%A2%EF%B8%8F" tabindex="-1">Dnevnik|Da biste stvorili,morate prvo uni\u0161titi! \u26a0\ufe0f\u2622\ufe0f</h1>\n<blockquote>\n<p>RS - Solarni dan 9695 / Ra\u010duna se po Zemaljskom vremenu\nLokacija:Galaksija ...</p>\n</blockquote>\n<p>&quot;Zitiroanci su dolazili i pretili napu\u0161tenoj bazi Drevnih,ta\u010dnije,razgovarali su sa AI-jem (Zemljani nemaju ni blizu toliko naprednu tehnologiju). Pretili su. Zitiroanci vode svoju galaksiju kao Imperija osvaja\u010da,porobili su sve civilizacije u svojoj galaksiji,ali nisu ni slutili na \u0161ta su naleteli \u2013 ili,bolje re\u0107i,na koga...&quot;</p>\n<p>Automatska kontrola baze:Pribli\u017eavate se za\u0161ti\u0107enoj zoni. Vratite se nazad. Va\u0161e vojno prisustvo ne\u0107e biti tolerisano.</p>\n<p>Zitiroanci:Vi \u0107ete nama nare\u0111ivati,pacovi u na\u0161oj galaksiji? Ko ste vi?</p>\n<p>Automatska kontrola baze:Ovo je nau\u010dno-istra\u017eiva\u010dka ispostava,nije vojna. Odbrambeni sistem \u0107e se aktivirati za 60 sekundi. Ponavljam,morate napustiti ovu zonu. Poslednje upozorenje.</p>\n<p>&quot;Zitiroanci su napali napu\u0161tenu bazu Drevnih. Posle dve sekunde od njihovog napada nisu ni sanjali kakvu \u0107e informaciju dobiti sa njihove rodne planete...&quot;</p>\n<p>Zitiroanska poruka:Ponavljam,napada nas nepoznata sila! Svuda su svemirski brodovi! Pojavili su se niotkuda! Dosta su napredniji od nas. Ponavljam svima:spa\u0161avajte se,spa\u0161avajte se! Sve je po\u010delo sa siluetama koje su igrale oko na\u0161e planete...</p>\n<p>Log koji je \u0160o pro\u010ditao naglas na mati\u010dnoj planeti Drevnih:</p>\n<ul>\n<li>Spaljena kolonija u zvezdanom oblaku Ohana</li>\n<li>Spaljeno preko 30 solarnih sistema</li>\n<li>Mati\u010dna planeta Zitiroanaca uni\u0161tena</li>\n<li>Sektor 30495 (pola galaksije) sterilisan od bilo kakvog oblika \u017eivota\n.\n.\n.</li>\n<li>Neprijateljska imperija pod \u0161ifrom F03945*** istrebljena...</li>\n<li>Broj \u017ertava:preko 950 trilijardi...</li>\n<li>Razlog napada:odbrana integriteta granice/teritorije...</li>\n<li>Trajanje napada:3 milisekunde...</li>\n</ul>\n<p>Kapetan Zitiroanskog broda:Oni su iz legendi? To su oni? Jao,bili smo glupi! Odlazi odavde punom brzinom,pre nego \u0161to nas sve istrebe. Njihova tehnologija je naprednija \u010dak i od postojanja na\u0161eg univerzuma i vremena...</p>\n<p>Posada:Kapetane?</p>\n<p>Kapetan Zitiroanskog broda:Rekao sam,odlazi!</p>\n<p>Za to vreme,na mati\u010dnoj planeti Drevnih...</p>\n<p>Kapljica:\u0160o,za\u0161to si ih istrebio? Sve do jednog iz njihove galaksije?</p>\n<p>\u0160o:Nisam sve. Nastavi\u0107e kao civilizacija na nivou kamenog doba. Mi,Drevni,volimo sve civilizacije,ali sve te civilizacije za koje smo stvorili galaksije,zvezde,svetove...\n...oni moraju znati gde im je mesto! Mi ne uni\u0161tavamo \u2013 samo disciplinujemo.</p>\n<p>Zakon Drevnih 3059-TVLFT-L\nOdobrava se upotreba smrtonosne sile koja ima rezultat oporavka i resetovanja cele civilizacije,ali samo onih koje su svesno stvorili Drevni. Zakon zabranjuje me\u0161anje u civilizacije,osim u slu\u010dajevima kada civilizacija ugro\u017eava fizi\u010dku ili energetsku (duhovnu) sigurnost Drevnih. Zakon je napisan i usvojen pre 900 kvadriliona godina.</p>\n<p>P.S. Sve civilizacije koje su Zitiroanci porobili sada su slobodne i nastavile su svoj \u017eivot normalno,kao i pre.</p>\n<p><img src="https://api.eronelit.com/app&id=A03429468246&blog=02_okt_2024_19_30/362361367" alt="1727891658493"></p>\n<h1 id="diary-%7C-to-create%2C-you-must-first-destroy!-%E2%9A%A0%EF%B8%8F%E2%98%A2%EF%B8%8F" tabindex="-1">Diary|To create,you must first destroy! \u26a0\ufe0f\u2622\ufe0f</h1>\n<blockquote>\n<p>EN - Solar Day 9695 / Calculated by Earth time\nLocation:Galaxy ...</p>\n</blockquote>\n<p>&quot;The Zitiroans came and threatened the abandoned base of the Ancients,or more precisely,they were talking to the AI (Earthlings don\'t have anything nearly as advanced). They threatened. The Zitiroans rule their galaxy as a conquering Empire,having enslaved all the civilizations in their galaxy,but they had no idea what \u2013 or better yet,who \u2013 they encountered...&quot;</p>\n<p>Automated Base Control:You are approaching a protected zone. Turn back. Your military presence will not be tolerated.</p>\n<p>Zitiroans:You dare give us orders,rats in our galaxy? Who are you?</p>\n<p>Automated Base Control:This is a scientific research outpost,not a military one. The defense system will activate in 60 seconds. I repeat,you must leave. Final warning.</p>\n<p>&quot;The Zitiroans attacked the abandoned base of the Ancients. Two seconds after their attack,they couldn\u2019t have imagined the information they were about to receive from their home planet...&quot;</p>\n<p>Zitiroan Message:I repeat,we are being attacked by an unknown force! There are ships everywhere! They appeared out of nowhere! They are far more advanced than we are. I repeat to everyone:save yourselves,save yourselves! It all began with silhouettes dancing around our planet...</p>\n<p>Log that \u0160o read aloud on the home planet of the Ancients:</p>\n<ul>\n<li>Burned colony in the Ohana star cloud\nOver 30 solar systems destroyed</li>\n<li>Zitiroan home planet annihilated</li>\n<li>Sector 30495 (half the galaxy) sterilized of any form of life\n.\n.\n.</li>\n<li>Enemy Empire under code F03945*** exterminated...</li>\n<li>Death toll:Over 950 trillion...</li>\n<li>Reason for the attack:Defense of territorial integrity...</li>\n<li>Duration of the attack:3 milliseconds...</li>\n</ul>\n<p>Captain of the Zitiroan ship:They\u2019re from the legends? It\u2019s them? Oh,we were so foolish! Get out of here at full speed before they wipe us all out. Their technology is more advanced than even the existence of our universe and time...</p>\n<p>Crew:Captain?</p>\n<p>Captain of the Zitiroan ship:I said,get out of here!</p>\n<p>Meanwhile,on the home planet of the Ancients...</p>\n<p>Kapljica:\u0160o,why did you exterminate them? Every last one from their galaxy?</p>\n<p>\u0160o:I didn\u2019t kill them all. They will continue as a Stone Age civilization. We,the Ancients,love all civilizations,but all those civilizations for which we have created galaxies,stars,worlds...\n...they must know their place! We don\u2019t destroy,we discipline.</p>\n<p>Law of the Ancients 3059-TVLFT-L\nThe use of deadly force is approved,which results in the recovery and resetting of an entire civilization,but only those consciously created by the Ancients. The law forbids interference in civilizations and is only allowed if a civilization threatens the physical or energetic (spiritual) security of the Ancients. The law was written and adopted 900 quadrillion years ago.</p>\n<p>P.S. All the civilizations that were enslaved by the Zitiroans are now free and have resumed their lives as they did before.</p>\n<p>#book #spacewar #aliens #war #begin #empire</p>\n\n </div>\n</body>\n</html>\n\n <dnm_footer>Last modified:02.okt.2024 19:30</dnm_footer><style type=\'text/css\'>\n @import url(\'https://fonts.googleapis.com/css2?family=Mulish:ital,wght@0,200;0,300;0,400;0,500;0,600;0,700;0,800;0,900;1,200;1,300;1,400;1,500;1,600;1,700;1,800;1,900&display=swap\');\n @import url(\'https://fonts.googleapis.com/css2?family=Poppins:ital,wght@0,100;0,200;0,300;0,400;0,500;0,600;0,700;0,800;0,900;1,100;1,200;1,300;1,400;1,500;1,600;1,700;1,800;1,900&display=swap\');\n \n </style><script type=\'text/javascript\'> </script><div class="cursor " style="opacity:0;"></div>\n \n </div>',
