        thumbail:
          "https://api.eronelit.com/app&id=A03429468246&blog=08_avg_2024_20_30/4313636236",
        category: ["book", "scifi", "deviantart"],
        gallery: [],
        shared_links: [],
        page: '<!DOCTYPE html>\n<html>\n<head>\n<title>08_avg_2024_20_30.md</title>\n<meta http-equiv="Content-type" content="text/html;charset=UTF-8">\n \n\n</head>\n<body>\n <div class="content-wrapper">\n <h1 id="dnevnik-%7C-rat---novosti-iz-sibirske-%2C-piramidalne-baze-drevnih..." tabindex="-1">Dnevnik|RAT - Novosti iz Sibirske,Piramidalne baze Drevnih...</h1>\n<p>RS - Solarni dan 9673 / Ra\u010duna se po Zemaljskom vremenu\nLokacija:U kafani,negde na planeti Zemlji...</p>\n<p>&quot;Stra\u017ene vojne snage Drevnih su danas uni\u0161tili preko 50 oklopnih vozila i 5 tenkova. I onemogu\u0107ili su preko 30 Nuklearnih napada na bazu od strane Ljudi. Napad na ljude je trajalo 0.0003 mili sekunde...</p>\n<p>Samo je petoro vojnika uspelo da izbegne smrt kada su se pribli\u017eili dimenzionom \u0161titu oko baze? \u010cim su dodirnuli \u0161tit umrli su u najsporijim ali i bizarnim mukama. Do\u017eivljavali su ubrzanu starost i podmla\u0111ivanje i da bukvalno gore u vatri i tako istovremeno...</p>\n<p>I ako je vojnicima smrt trajala 20 godina u stvarnosti je pro\u0161lo jedva mikro sekunda... Dilatacija vremena ( Termin u kvatnoj fizici). Za razliku od svih bi\u0107a Drevni mogu da pro\u0111u kroz \u0161tit kao da ni\u0161ta nije bilo. \u0160tit je debeo dva kilometra... &quot;</p>\n<p>General baze:Baza je sigurna.</p>\n<p>\u0160o:Ljudska bi\u0107a nikako da nau\u010de ni posle 20 hiljada godina.\nSigurna? Super. Super...</p>\n<ul>\n<li>Tra\u017eila vas je Terranska princeza. Rekla je da do\u0111ete kod nje.</li>\n</ul>\n<p>\u0160o:Super. Spremite krstaricu...</p>\n<p>&quot;Sve do pre nekoliko godina Ljudima je bilo dopu\u0161teno kao nau\u010dnici da ulaze u bazu Drevnih na Antarktiku. Da li znate za\u0161to je Antarktik za\u0161ti\u0107en od vojnog delovanja? Da ni jedna dr\u017eava na papiru ne poseduje ceo Antarktiku? &quot;</p>\n<p>P.S Najbr\u017ei dogovor svih dr\u017eava oko teritorije koja ima tone i tone zlata,srebra? Zanimljivo zar ne?...</p>\n<p><img src="https://api.eronelit.com/app&id=A03429468246&blog=08_avg_2024_20_30/4313636236" loading="lazy" alt="4313636236"></p>\n<h1 id="diary-%7C-war---news-from-siberia%2C-pyramid-bases-of-the-ancients..." tabindex="-1">Diary|WAR - News from Siberia,Pyramid bases of the Ancients...</h1>\n<p>EN - Solar day 9673 / Calculated according to Earth time\nLocation:In a tavern,somewhere on planet Earth...</p>\n<p>&quot;The Ancient Guard military forces destroyed over 50 armored vehicles and 5 tanks today. And disabled over 30 Nuclear attacks on the base by the Humans. The attack on the Humans took 0.0003 milliseconds...</p>\n<p>Only five soldiers managed to escape death when they approached the dimensional shield around the base? As soon as they touched the shield,they died in the slowest but most bizarre agony. They were experiencing accelerated aging and rejuvenation and that they were literally burning in fire and so at the same time...</p>\n<p>And if it took 20 years for the soldiers to die,in reality it was barely a micro second... Time Dilation (a term in quantum physics). Unlike all creatures the Ancients can pass through the shield as if nothing had happened. The shield is two kilometers thick... &quot;</p>\n<p>Base General:The base is secure.</p>\n<p>\u0160o:Human beings can never learn even after 20 thousand years.</p>\n<p>Are you sure? Great. Great...</p>\n<ul>\n<li>The Terran princess was looking for you. She said to come to her place.</li>\n</ul>\n<p>\u0160o:Great. Prepare the cruiser...</p>\n<p>&quot;Until a few years ago,Humans were allowed as scientists to enter the Ancients\' base in Antarctica. Do you know why Antarctica is protected from military action? That no country on paper owns all of Antarctica? &quot;</p>\n<p>P.S. The fastest agreement of all countries over a territory that has tons and tons of gold and silver? Interesting isn\'t it?...</p>\n\n </div>\n</body>\n</html>\n\n <dnm_footer>Last modified:08.avg.2024 20:30</dnm_footer><style type=\'text/css\'>\n @import url(\'https://fonts.googleapis.com/css2?family=Mulish:ital,wght@0,200;0,300;0,400;0,500;0,600;0,700;0,800;0,900;1,200;1,300;1,400;1,500;1,600;1,700;1,800;1,900&display=swap\');\n @import url(\'https://fonts.googleapis.com/css2?family=Poppins:ital,wght@0,100;0,200;0,300;0,400;0,500;0,600;0,700;0,800;0,900;1,100;1,200;1,300;1,400;1,500;1,600;1,700;1,800;1,900&display=swap\');\n \n </style><script type=\'text/javascript\'> </script><div class="cursor " style="opacity:0;"></div>\n \n </div>',
