        page: '<!DOCTYPE html>\n<html>\n<head>\n<title>14_avg_2024_13_25.md</title>\n<meta http-equiv="Content-type" content="text/html;charset=UTF-8">\n \n\n</head>\n<body>\n <div class="content-wrapper">\n <h1 id="dnevnik-%7C-na-samoj-granici-ljudima-nepoznatog-univerzuma...--" tabindex="-1">Dnevnik|Na samoj granici Ljudima nepoznatog univerzuma... -</h1>\n<blockquote>\n<p>RS - Solarni dan 1948 / Ra\u010duna se po Zemaljskom vremenu</p>\n</blockquote>\n<p>Lokacija:Galaksija... Preko 480 kvadriliona svetlosnih godina od planete Zemlje...</p>\n<ul>\n<li>\u0160o? Uskoro sle\u0107emo na planetu...</li>\n</ul>\n<p>\u0160o:Da,vidi kroz prozor,prelepo je...</p>\n<p>Savetnik:Radili smo po tvom uputstvima. Trebalo nam je 3 dana da napravimo ceo solarni sistem i planetu...</p>\n<p>\u0160o:Prelepo je. Krenuli su ve\u0107 da lansiraju svemirske brodove u ni\u0161tavilo... Svaka \u010dast...</p>\n<p>&quot;\u0160o je bio odu\u0161evljen i presre\u0107an...\nSvemirski brod u kom je bio,sletao je na novu nau\u010dnoistra\u017eiva\u010dku i vojnu koloniju Drevnih. Sa te kolonije Drevni \u0107e da nastave stvaranje svetova i o\u010duvanje postoje\u0107ih... Na planeti se de\u0161avala Ceremonija povodom dolaska \u0160o-a kao vrhovnog Drevnog,kralja svih Drevnih i zapo\u010dinjanja stvaranja ... &quot;</p>\n<ul>\n<li>Stigli smo,spreman si?</li>\n</ul>\n<p>\u0160o:Jesam...</p>\n<p>&quot;Ceremonija je bila super,nad kraj Ceremonije Guvnereri koji \u0107e voditi koloniju moraju da daju zakletvu i na kraju \u0160o mora da da ime koloniji ta\u010dnije planeti ako Guvnereri ne daju sve predloge,odabir imena odlu\u010duje celo kraljestvo Drevnih ... &quot;</p>\n<p>Kapljica:\u0160o celo kraljestvo \u017eeli tvoj predlog imena i Guvnereri se sla\u017eu...</p>\n<p>&quot;\u0160o je iza\u0161ao na binu uz osmeh toliko je bio presre\u0107an... &quot;</p>\n<p>\u0160o:Dobro. Odlu\u010dio sam se za ime. Ta osoba \u0107e \u017eiveti mnogo du\u017ee kroz ovu koloniju,svi znate ko je ona. Drugarica sa planete Zemlje. Kolonija \u0107e se zvati ***** . To je njeno pravo ime... To je moj poklon njoj...</p>\n<p>&quot;Kada je rekao ime kolonije svi su krenuli da aplaudiraju,posle 5 minuta doneli su Sferu kada je \u0160o stavio ruku na nju ona je zasvetlela to je ozna\u010davalo da je Kolonija ***** spremna... &quot;</p>\n<p>Kapljica:... Gotova ceremonija pre dva sata. \u010cestitam \u0160o! Mnogo si ti meni presre\u0107an danas? \u0160ta se de\u0161ava?</p>\n<p>\u0160o:Ne\u0161to se desilo u svemirskom brodu dok sam bio...</p>\n<p>Kapljica:... opet si? \u0160o? Sada je meni jasno hahahah,\nidemo na sladoled nas petoro?...</p>\n<p>P.S Idemo naravno.\nPlaneta od tada do danas nosi njeno ime...</p>\n<p><img src="https://api.eronelit.com/app&id=A03429468246&blog=14_avg_2024_13_25/432423136" alt="432423136"></p>\n<h1 id="diary-%7C-at-the-very-border-of-a-universe-unknown-to-humans...--" tabindex="-1">Diary|At the very border of a universe unknown to humans... -</h1>\n<blockquote>\n<p>EN- Solar Day 1948 / Calculated according to Earth Time</p>\n</blockquote>\n<p>Location:Galaxy... Over 480 quadrillion light years from Earth...</p>\n<ul>\n<li>What? Soon we will land on the planet...</li>\n</ul>\n<p>\u0160o:Yes,look out the window,it\'s beautiful...</p>\n<p>Advisor:We worked according to your instructions. It took us 3 days to make the entire solar system and the planet\u2026</p>\n<p>\u0160o:It\'s beautiful. They have already started to launch spaceships into nothingness... Kudos...</p>\n<p>&quot;\u0160o was delighted and overjoyed...</p>\n<p>The spaceship he was in landed on a new scientific research and military colony of the Ancients. From that colony,the Ancients will continue the creation of worlds and the preservation of the existing ones... On the planet,a Ceremony was taking place on the occasion of the arrival of \u0160o as the supreme Ancient,king of all the Ancients and the beginning of creation...&quot;</p>\n<ul>\n<li>We have arrived,are you ready?</li>\n</ul>\n<p>\u0160o:I did...</p>\n<p>&quot;The ceremony was great,at the end of the ceremony the Governors who will lead the colony must take an oath and at the end \u0160o must name the colony or more precisely the planet if the Governors do not give all the proposals,the choice of name is decided by the whole Kingdom of the Ancients...&quot;</p>\n<p>Kapljica:The whole kingdom wants your name proposal and the Governors agree...</p>\n<p>&quot;\u0160o came out on stage with a smile,he was so overjoyed...&quot;</p>\n<p>\u0160o:Good. I decided on a name. That person will live much longer through this colony,you all know who she is. A friend from planet Earth. The colony will be called *****. That\'s her real name... That\'s my gift to her...</p>\n<p>&quot;When he said the name of the colony everyone started applauding,after 5 minutes they brought the Sphere when \u0160o put his hand on it it lit up that meant Colony ***** was ready...&quot;</p>\n<p>Kapljica:... The ceremony was finished two hours ago. Congratulations \u0160o! Are you too happy for me today? What\'s going on?</p>\n<p>\u0160o:Something happened in the spaceship while I was...</p>\n<p>Kapljica:... you again? What? Now it\'s clear to me hahahah,</p>\n<p>let\'s go for ice cream,the five of us?...</p>\n<p>P.S. Let\'s go of course.</p>\n<p>The planet has been named after her since then...</p>\n\n </div>\n</body>\n</html>\n\n <dnm_footer>Last modified:14.avg.2024 13:24</dnm_footer><style type=\'text/css\'>\n @import url(\'https://fonts.googleapis.com/css2?family=Mulish:ital,wght@0,200;0,300;0,400;0,500;0,600;0,700;0,800;0,900;1,200;1,300;1,400;1,500;1,600;1,700;1,800;1,900&display=swap\');\n @import url(\'https://fonts.googleapis.com/css2?family=Poppins:ital,wght@0,100;0,200;0,300;0,400;0,500;0,600;0,700;0,800;0,900;1,100;1,200;1,300;1,400;1,500;1,600;1,700;1,800;1,900&display=swap\');\n \n </style><script type=\'text/javascript\'> </script><div class="cursor " style="opacity:0;"></div>\n \n </div>',
