        category: ["book", "scifi", "princess", "deviantart"],
        gallery: [],
        shared_links: [],
        page: "<!DOCTYPE html>\n<html>\n<head>\n<title>13_april_2024_11_45.md</title>\n<meta http-equiv=\"Content-type\" content=\"text/html;charset=UTF-8\">\n\n \n\n</head>\n<body>\n <div class=\"content-wrapper\">\n <h1 id=\"dnevnik-%7Cpripreme-za-ro%C4%91endan-terranske-princeze-alss'see\" tabindex=\"-1\">Dnevnik|Pripreme za ro\u0111endan Terranske princeze Alss'see</h1>\n<blockquote>\n<p>RS - Solar day 9616 / Calculated according to Earth time</p>\n</blockquote>\n<p>Lokacija:Terrana,originalna mati\u010dna planeta Ljudi...</p>\n<p>Terran Queen ( Alss'sea mother ):\u0160o,Kapljice? Stigli ste. Pratite me...</p>\n<p>&quot;Kraljica ih je odvela do Terranske palate,Kapljica i Terranska kraljica pri\u010dali su kako idu pripreme za Alss'sein ro\u0111endan,Kapljica voli da ukra\u0161ava za sve\u010dane doga\u0111aje pa se ponudila da pomogne...</p>\n<p>\u0160o je \u0107utao i zamislio se ne\u0161to... &quot;</p>\n<p>Kapljica:\u0160o? Do\u0111i sa nama \u0161to si iza?</p>\n<p>\u0160o:... pri\u010date vas dve da vas ne ometam...</p>\n<p>&quot;... prave se nove kolonije,grade se nove galaksije,novi svetovi.\nRazmi\u0161ljao je o planu. Jer kada napusti planetu Zemlju po\u010dinje sa poslom Drevnih. Ipak je planeta Zemlja samo njegov trenutni odmor...</p>\n<p>... stigli su do njene sobe.&quot;</p>\n<p>Alss'sea:Kako vam izgledam?</p>\n<p>Kapljica i \u0160o:Prelepa si...</p>\n<p>&quot;Terranci \u017eive najmanje 1500 godina,dok ljudi na planeti Zemlji \u017eive maksimalno 90-120 godina,bili su nekoliko sati na Terrani pri\u010dali su svo \u010detvoro u svemu posle je Kraljica oti\u0161la,\u0160o,Kapljica i Alss'sea oti\u0161li su napolje da se igraju u snegu. Na Terrani trenutno pada sneg,zimsko je doba. Toliko su se Zabavljali da je \u0160o zaboravio da se vrati na Zemlju.</p>\n<p>Na Alss'sein ro\u0111endan pada sneg i na taj dan dolazi retka ptica koja li\u010di na Feniksa ali ptica nije bila vatrena nego ledena... &quot;</p>\n<p>P.S Da li ste \u010duli za feniksa koji se ponovno ra\u0111a iz leda? A ne samo iz pepela?</p><br><br>\n<hr><br><br><p>Photo:Her Highness,the princess Alss'sea </p>\n<p><img src=\"https://api.eronelit.com/app&id=A03429468246&blog=13_april_2024_11_45/1720867464514\" alt=\"1720867464514\"></p>\n<hr><br><br>\n<h1 id=\"diary-%7C-preparations-for-terran-princess-alss'see's-birthday\" tabindex=\"-1\">Diary|Preparations for Terran Princess Alss'see's birthday</h1>\n<p>Location:Terrana,the original home planet of Humans...</p>\n<p>Terran Queen ( Alss'sea mother ):What,Drops? You have arrived. Follow me...</p>\n<p>&quot;The Queen led them to the Terran Palace,Droplet and the Terran Queen talked about how the preparations for Alss'sea birthday were going,Droplet likes to decorate for festive events so she offered to help...</p>\n<p>Shaw was silent and thought about something...&quot;</p>\n<p>Droplet:What? Come with us what are you behind?</p>\n<p>Shaw:... you two are talking so I don't disturb you...</p>\n<p>&quot;... new colonies are being built,new galaxies are being built,new worlds are being built.\nHe thought of a plan. Because when he leaves planet Earth,he begins the work of the Ancients. After all,planet earth is only his temporary vacation...</p>\n<p>... they reached her room. &quot;</p>\n<p>Alss'sea:How do I look to you?</p>\n<p>Kapljica and Shaw:You are beautiful...</p>\n<p>&quot;Terrans live at least 1500 years,while humans on planet Earth live a maximum of 90-120 years,they were on Terran for a few hours,the four of them talked about everything,after the Queen left,Shaw,Droplet and Alss'sea went outside to play in snow. It's snowing on Terran right now. They were having so much fun that Shaw forgot to come back to Earth.</p>\n<p>It snows on Alss'sea birthday and on that day a rare bird comes that looks like a phoenix but the bird was not fiery but icy... &quot;</p>\n<p>P.S Have you heard of the phoenix reborn from ice? And not just from the ashes?</p>\n<br><br>\n<p>#book</p>\n </div>\n</body>\n</html>\n\n <dnm_footer>Last modified:13.jul.2024 11:45</dnm_footer><style type='text/css'>\n @import url('https://fonts.googleapis.com/css2?family=Mulish:ital,wght@0,200;0,300;0,400;0,500;0,600;0,700;0,800;0,900;1,200;1,300;1,400;1,500;1,600;1,700;1,800;1,900&display=swap');\n @import url('https://fonts.googleapis.com/css2?family=Poppins:ital,wght@0,100;0,200;0,300;0,400;0,500;0,600;0,700;0,800;0,900;1,100;1,200;1,300;1,400;1,500;1,600;1,700;1,800;1,900&display=swap');\n \n </style><script type='text/javascript'> </script><div class=\"cursor \" style=\"opacity:0;\"></div>\n \n </div>",
