        gallery: [],
        page: '<!DOCTYPE html>\n<html>\n<head>\n<title>11_jun_2024_13_00.md</title>\n<meta http-equiv="Content-type" content="text/html;charset=UTF-8">\n\n \n\n</head>\n<body>\n <div class="content-wrapper">\n <h1 id="dnevnik-%7C-gradili%C5%A1te-svetova-.-.-." tabindex="-1">Dnevnik|Gradili\u0161te svetova . . .</h1>\n<blockquote>\n<p>RS - Solarni dan 9584 / Ra\u010duna se po Zemaljskom vremenu</p>\n</blockquote>\n<p>Lokacija:Gradili\u0161te svetova. Jedna od kolonija Drevnih. Galaksija ...</p>\n<ul>\n<li>... stigao si \u0160o? Kako je bilo na planeti Zemlji?</li>\n</ul>\n<p>\u0160o:Bilo je super,chill danas bio. Predivno je. Ogromno je...</p>\n<p>&quot;Bili su u orbiti u jednom svemirskom hangaru bila je gotova jednog svemirskog broda Drevnih. Svemirski brod je dobio ime Ksena \u0161to na Drevnom zna\u010di \u017divot! Ksena je bila devojka od \u0160oa koja je umrla u pro\u0161loj dimenziji...</p>\n<p>... u svemirski brod tada je ulazila posada. Namena broda je bila da istra\u017euje galaksije,zvezde i \u017eivot koji su nastali prirodnim putem i da stvara tamo ih nema. &quot;</p>\n<p>Kapljica:Predivno je. Doneli su Sveru. Poka\u017ei kako to radi\u0161?</p>\n<p>&quot;Svera od jedva pola metra je napajala ceo svemirski brod bila je neaktivna samo je \u0160o mo\u017ee aktivirati... &quot;</p>\n<p>\u0160o:... gledaj. Stavim ruku na sveru ovako ....</p>\n<p>&quot;Kako je \u0160o krenuo da stavlja ruku vrata hangara krenula su da se otvaraju,sigurnosne gravitacione-magnetne rampe koje su dr\u017eale svemirski brod krenule su da se odvajaju,svemirski brod kao da je o\u017eiveo... &quot;</p>\n<p>\u0160o:... sada stavim ruku i eto. Svera je zasvetlela hahaha...</p>\n<p>Kapljica:Wow... Odnose Sveru unutra?...</p>\n<p>&quot;Mislila je da \u0107e ne\u0161to spektakularno da se desi ... &quot;</p>\n<p>\u0160o:Da. \u010cim je postave na mesto svemirski brod Ksena. Zauvek \u0107e da ode odavde,brzinom od 500 kvadriliona svetlosnih godina u deli\u0107u sekunde... Vrati\u0107e se samo ako nai\u0111u na ne\u0161to....</p>\n<p>Kapljica:Na \u0161ta?...</p>\n<p>\u0160o:Na prirodne portale koji vode do na\u0161e pro\u0161le dimenzije. Gde se ja nadam da je nastavljen \u017eivot posle uni\u0161tenja dimenzije od onog trenutka kada smo ga napustili ...</p>\n<p>Kapljica:Aktiviraju \u0161tit,proveravaju oru\u017eje? Topove? Odlaze?...</p>\n<p>\u0160o:Da! Odlaze...</p>\n<p>&quot;Zauvek je u o\u010dima Drevnih jedna deli\u0107 \u017eivota zbog \u017eivotnog veka ovog univerzuma. Kada je svemirski brod bio spreman da ode svi su se poklonili u hangaru iz po\u0161tovanja.\nKada je svemirski brod Ksena oti\u0161la? Svi su bili presre\u0107ni,Kapljica i \u0160o su se u sre\u0107i nesvesno poljubili... Posle 5 sekundi stigla je poruka... &quot;</p>\n<p>P.S Ovde kapetan svemirskog broda Ksena,udaljeni smo od vas preko 950 Gugola(broj sa 100 nula) svetlosnih godina. Zamislite takvu tehnologiju... Cela posada vam \u0161alje pozdrave!...</p>\n<hr>\n<h1 id="diary-%7C-building-site-of-worlds.-.-.--" tabindex="-1">Diary|Building site of worlds. . . -</h1>\n<blockquote>\n<p>EN - Solar day 9584 / Calculated according to Earth time</p>\n</blockquote>\n<p>Location:Building of Worlds. One of the colonies of the Ancients. Galaxy ...</p>\n<ul>\n<li>... have you arrived \u0160o? How was it on planet earth?</li>\n</ul>\n<p>\u0160o:It was great,it was chill today. It\'s beautiful. It\'s huge...</p>\n<p>&quot;They were in orbit in a space hangar where an Ancient spaceship was built. The spaceship was named Ksena which in Ancient means Life! Ksena was a \u0160o girl who died in a previous dimension...</p>\n<p>... the crew then entered the spaceship. The purpose of the ship was to explore galaxies,stars and life that arose naturally and to create none there. &quot;</p>\n<p>Kapljica:It\'s beautiful. They brought it to Sphere. Show how you do it?</p>\n<p>&quot;The barely half-meter Sphere powered the entire spaceship,it was inactive,only \u0160o can activate it...&quot;</p>\n<p>\u0160o:... look. I put my hand on everything like this ...</p>\n<p>&quot;As \u0160o began to put his hand in the hangar doors began to open,the safety gravity-magnetic ramps that held the spaceship began to separate,the spaceship seemed to come to life...&quot;</p>\n<p>\u0160o:... now I put my hand in and there it is. Everything lit up hahaha...</p>\n<p>Kapljica:Wow... Are they taking Sphere inside?...</p>\n<p>&quot;She thought something spectacular was going to happen...&quot;</p>\n<p>\u0160o:Yes. As soon as they put her in place the spaceship Ksena. They will leave here forever,at 500 quadrillion light years in a split second... They will only come back if they encounter something....</p>\n<p>Kapljica:To what?...</p>\n<p>\u0160o:To the natural portals that lead to our past dimension. Where I hope life continued after the destruction of the dimension from the moment we left it...</p>\n<p>Kapljica:Activate shield,check weapon? Cannons? Leaving?...</p>\n<p>\u0160o:Yes! Leaving...</p>\n<p>&quot;Forever in the eyes of the Ancient Ones is a fraction of life because of the life span of this universe. When the spaceship was ready to leave they all bowed in the hangar in respect.\nWhen did spaceship Ksena leave? Everyone was overjoyed,Kapljica and \u0160o unconsciously kissed each other in happiness... After 5 seconds,a message arrived... &quot;</p>\n<p>P.S This is the captain of the spaceship Ksena,we are over 950 Googol (a number with 100 zeros) light years away from you. Imagine such technology... The whole crew sends you greetings!...</p>\n<br><br>\n\n<br><br><p><img loading="lazy" src="https://api.eronelit.com/app&id=A03429468246&blog=11_jun_2024_13_00/424423094" alt="424423094"></p>\n<br><br>\n<p class="p_divantorts"><span><img loading="lazy" src="/?svc=icon_deviantart" style="pointer-events:none;" \n title="Deviantart Logo"/> View on Deviantart:</span><a\n href="https://www.deviantart.com/marko9827/art/1062586669" target="_blank"\n title="https://www.deviantart.com/marko9827/art/1062586669" rel="nofollow noreferrer" role="link">https://www.deviantart.com/marko9827/art/1062586669</a></p>\n<br><br>\n\n </div>\n</body>\n</html>\n\n <dnm_footer>Last modified:11.jun.2024 13:00</dnm_footer><style type=\'text/css\'>\n @import url(\'https://fonts.googleapis.com/css2?family=Mulish:ital,wght@0,200;0,300;0,400;0,500;0,600;0,700;0,800;0,900;1,200;1,300;1,400;1,500;1,600;1,700;1,800;1,900&display=swap\');\n @import url(\'https://fonts.googleapis.com/css2?family=Poppins:ital,wght@0,100;0,200;0,300;0,400;0,500;0,600;0,700;0,800;0,900;1,100;1,200;1,300;1,400;1,500;1,600;1,700;1,800;1,900&display=swap\');\n \n </style><script type=\'text/javascript\'> </script><div class="cursor " style="opacity:0;"></div>\n \n </div>',
