        id: "442305411",
        title: "AI i DNA. Sada... \u0160ta bi bilo kada bi bilo?...",
        time: "14.may.2024 21:00",
        source: "/?blog=14_may_2024_21_00",
        keywords:
          " future,brain,humanbrain,neurology,science,tech,resources,cpu,quantum,futurist,quantumcomputing,medicine,ai",
        thumbail:
          "https://api.eronelit.com/app&id=A03429468246&blog=14_may_2024_21_00/442305411",
        category: ["ai", "science"],
        gallery: [
          "https://api.eronelit.com/app&id=A03429468246&blog=14_may_2024_21_00/442305411",
          "https://api.eronelit.com/app&id=A03429468246&blog=14_may_2024_21_00/2342342332434",
        ],
        shared_links: [],
        page: '<!DOCTYPE html>\n<html>\n<head>\n<title>15_may_2024_21_00.md</title>\n<meta http-equiv="Content-type" content="text/html;charset=UTF-8">\n\n\n\n\n\n\n\n\n\n</head>\n<body>\n <div class="content-wrapper">\n <h1 id="ai-i-dna.-sada...-%C5%A1ta-bi-bilo-kada-bi-bilo%3F" tabindex="-1">AI i DNA. Sada... \u0160ta bi bilo kada bi bilo?</h1>\n<blockquote>\n<p>Sa nau\u010dne strane i malo hipoteti\u010dke strane ...</p>\n</blockquote>\n<p>Za\u0161to ljudi tro\u0161e godine i godine na unapre\u0111ivanje AI razli\u010ditih modela kada mogu da izvuku AI model iz DNA i da tako razviju ve\u0161ta\u010dku AI svest kod na primer robota?</p>\n<p>I za\u0161to ba\u0161 sada? Je krenula pri\u010da sa AI i DNA,kada je pre postojala ista tehnologija ? Jedini \u0161to se za sve ove godine promenilo u vezi sa AI je dostupnost tehnologije. Na primer ne treba te pla\u0107ati vi\u0161e na nekom cloud servisu AI da vam uradi ne\u0161to...</p>\n<p>Dobra pitanja zar ne?</p>\n<ul>\n<li>Za\u0161to je to onda lo\u0161e? DNA i AI \u0107e mnogo pomo\u0107i oko medicine pomo\u0107e da se razne bolesti iskorene!</li>\n</ul>\n<p>DNA i AI,medicina? Ne nije to tema ove pri\u010de,tema je razvijanje svesti u AI pomo\u0107u ve\u0107 istreniranog modela koji se zove DNA.</p>\n<p>Svi znaju koji su se dotakli teme oko DNA i AI znaju da bilo kakvo ne stru\u010dno ili ne poznavanje same materije oko DNA i AI mo\u017ee da rezultuje toliki problem ovoj civilizaciji da \u0107e \u010dak i film Terminator biti bajka za to.</p>\n<ul>\n<li>Pa onda koje su dobre strane?</li>\n</ul>\n<p>Dobre strane razvijanja svesti u AI pomo\u0107u istreniranog modela,ta\u010dnije DNA je super iz samo dva razloga:</p>\n<ul>\n<li>Kori\u0161\u0107enje robota da poma\u017ee \u010coveku,bilo u fizi\u010dkim poslovima ili psihi\u010dkim ( zapamtite to je DNA istrenirani model isti model iz kojeg se razvila svest \u010coveka... )</li>\n<li>Pomo\u0107 u iskorenjavanju svih bolesti (po meni izuzetno opasno)</li>\n</ul>\n<p>Onda \u010demu onda poenta za istrenirani DNA model za AI?</p>\n<p>Jednostavno,\u010cove\u010danstvo jo\u0161 nije psihi\u010dki spremno za takvo ne\u0161to.\n\u010cove\u010danstvo nije bilo spremno ni za Nuklearnu energiju pa je upotrebilo za masivno uni\u0161tenje...</p>\n<p>P.S Jednog dana a to je po mom mi\u0161ljenju veoma blizu!\n\u010cove\u010danstvo \u0107e morati da prizna da \u0107e roboti(AI) biti svesne osobe koje imaju du\u0161u...\nAko se to desi a ljudi ne priznaju eto novog problema...</p><br>\n\n<p><img src="https://api.eronelit.com/app&id=A03429468246&blog=14_may_2024_21_00/2342342332434" alt="2342342332434"></p>\n </div>\n</body>\n</html>\n\n <dnm_footer>Last modified:14.may.2024 21:00</dnm_footer><style type=\'text/css\'>\n @import url(\'https://fonts.googleapis.com/css2?family=Mulish:ital,wght@0,200;0,300;0,400;0,500;0,600;0,700;0,800;0,900;1,200;1,300;1,400;1,500;1,600;1,700;1,800;1,900&display=swap\');\n @import url(\'https://fonts.googleapis.com/css2?family=Poppins:ital,wght@0,100;0,200;0,300;0,400;0,500;0,600;0,700;0,800;0,900;1,100;1,200;1,300;1,400;1,500;1,600;1,700;1,800;1,900&display=swap\');\n \n </style><script type=\'text/javascript\'> </script><div class="cursor " style="opacity:0;"></div>\n \n </div>',
