        category: ["deviantart", "science", "book", "image"],
        gallery: [],
        shared_links: [],
        page: '<!DOCTYPE html>\n<html>\n<head>\n<title>17_apr.2024_15_00.md</title>\n<meta http-equiv="Content-type" content="text/html;charset=UTF-8">\n\n\n\n\n\n\n\n\n\n</head>\n<body>\n <div class="content-wrapper">\n <h1 id="in-the-future%2C-people-will-be-able-to-share-resources-from..." tabindex="-1">In the future,people will be able to share resources from...</h1>\n<p>In the future,people will be able to share resources from their brain to their computer. Wireless of course.\nLike from another computer...</p>\n<ul>\n<li>That\'s impossible!</li>\n</ul>\n<p>That\'s what they told me about AI in 2014. That it\'s not possible...</p>\n<p>P.S From near future?...</p>\n<blockquote>\n<p>Diagram</p>\n<p><img src="https://api.eronelit.com/app&id=A03429468246&blog=17_apr.2024_15_00/1713373783520" alt="1713373783520"></p>\n</blockquote>\n\n </div>\n</body>\n</html>\n\n <dnm_footer>Last modified:14.april.2024 16:27</dnm_footer><style type=\'text/css\'>\n @import url(\'https://fonts.googleapis.com/css2?family=Mulish:ital,wght@0,200;0,300;0,400;0,500;0,600;0,700;0,800;0,900;1,200;1,300;1,400;1,500;1,600;1,700;1,800;1,900&display=swap\');\n @import url(\'https://fonts.googleapis.com/css2?family=Poppins:ital,wght@0,100;0,200;0,300;0,400;0,500;0,600;0,700;0,800;0,900;1,100;1,200;1,300;1,400;1,500;1,600;1,700;1,800;1,900&display=swap\');\n \n </style><script type=\'text/javascript\'> </script><div class="cursor " style="opacity:0;"></div>\n \n </div>',
