        keywords:
          "culinaryart,culinarydelight,foodart,foodphotography,gyros,streetfood,mediterraneanfood,fooddrawing,tastytreat,traditionalfood,artisticfood,greekcuisine,foodillustration,greekculture,yummymeal,savorydish,deliciousdish,gyrosandwich,greekflavors,greekdelight",
        thumbail:
          "https://api.eronelit.com/app&id=A03429468246&blog=14_april_2024_16_27/1713104995804",
        category: ["deviantart", "book", "image"],
        gallery: [],
        shared_links: [],
        page: '<!DOCTYPE html>\n<html>\n<head>\n<title>14_april_2024_16_27.md</title>\n<meta http-equiv="Content-type" content="text/html;charset=UTF-8">\n\n\n\n\n\n\n\n\n\n</head>\n<body>\n <div class="content-wrapper">\n <h1 id="dnevnik---sibir-%7C-solarni-dan-9525-%2F-ra%C4%8Duna-se-po-zemaljskom-vremenu" tabindex="-1">Dnevnik - Sibir|Solarni dan 9525 / Ra\u010duna se po Zemaljskom vremenu</h1>\n<p>&quot;Blizu baze Drevnih u Sibiru,dva vojnika su uspeli da do\u0111u do granice sa bazom pe\u0161aka i posmatrali su ne\u0161to \u0161to ih je za\u010dudilo u pozitivnom i u isto vreme u negativnom smislu... &quot;</p>\n<p>Vojnik:\u0160ta to rade ?</p>\n<ul>\n<li>Prikupljaju \u017eivotinje iz celog sveta,kao Arka nekakva i odvode ih u piramidu,u njihovu bazu u planinama ...</li>\n</ul>\n<p>Vojnik:Pazi!</p><br><br>\n<p><img src="https://api.eronelit.com/app&id=A03429468246&blog=14_april_2024_16_27/1713104995804" alt="1713104995804"></p><br><br>\n<p>&quot;Ogromni medved od 4 metra samo je pogledao dva vojnika i nastavio je svojim putem ka bazi Drevnih... Magnetni \u0161tit je pu\u0161tao \u017eivotinje. Jedan od dvoje vojnika je probao da pro\u0111e kroz \u0161tit tako \u0161to je hodao odma uz medveda ali se vojnik pretvorio iste sekunde u prah... &quot;</p>\n<p>Vojnik u sebi:Zar smo mi kao ljudi na ovoj planeti stvarno lo\u0161i? Pogledao je ka dole i krenuo je da pla\u010de...</p>\n<p>&quot;Neki ne\u017eni glas,ne\u0161to je stajalo ispred uplakanog vojnika li\u010dilo je na osobu u beloj ode\u0107i... Ali vojnik nije mogao da vidi lice od te osobe... &quot;</p>\n<p>Ne\u017eni glas:Ne brini,ne\u0107emo vas povrediti,tebe niti tvoju civilizaciju. Sve je do vas ljudi da li \u0107ete uni\u0161titi va\u0161u civilizaciju. Mi smo svuda po planeti i posmatramo vas...</p>\n<p>Vojnik:Medved? Gde je oti\u0161ao?</p>\n<p>P.S ... u rajski vrt. Tako zovete to mesto zar ne?</p>\n<p>\ud83d\udc96\ud83d\udc7d\ud83e\ude90\ud83d\udc3b\u2728</p>\n<p>#book #diary #bear</p>\n\n </div>\n</body>\n</html>\n\n <dnm_footer>Last modified:14.april.2024 16:27</dnm_footer><style type=\'text/css\'>\n @import url(\'https://fonts.googleapis.com/css2?family=Mulish:ital,wght@0,200;0,300;0,400;0,500;0,600;0,700;0,800;0,900;1,200;1,300;1,400;1,500;1,600;1,700;1,800;1,900&display=swap\');\n @import url(\'https://fonts.googleapis.com/css2?family=Poppins:ital,wght@0,100;0,200;0,300;0,400;0,500;0,600;0,700;0,800;0,900;1,100;1,200;1,300;1,400;1,500;1,600;1,700;1,800;1,900&display=swap\');\n \n </style><script type=\'text/javascript\'> </script><div class="cursor " style="opacity:0;"></div>\n \n </div>',
