        page: '<!DOCTYPE html>\n<html>\n<head>\n<title>10_dec_2023_11_45.md</title>\n<meta http-equiv="Content-type" content="text/html;charset=UTF-8">\n\n\n\n\n\n\n\n\n\n</head>\n<body>\n <div class="content-wrapper">\n <h1 id="ai-in-cyber-security---security-zone" tabindex="-1">AI IN CYBER SECURITY - SECURITY ZONE</h1>\n<p>AI is also used,which simulates and learns from every second and up to the results of a cyber attack. Simulations last from 3 to 5 minutes.</p>\n<p>4 AIs in two groups participate in the simulation.</p>\n<p>The task of the first group is to destroy the defense of the second group</p>\n<p>while the task of the other group is to defend themselves and if they give in,learn from their mistakes and how they were attacked.</p>\n<p>While others use AI for safety in the form of a chat that recommends what you should do...</p>\n<p>The process has been going on since 2015...</p>\n<p>The AI is meant to fight against the falling AI.</p>\n<p>2019 AI named Interceptor is introduced in Security system and protects servers.</p>\n<p>Outside the simulation the Interceptor protected and neutralized through:</p>\n<table>\n<thead>\n<tr>\n<th>Name</th>\n<th>Number</th>\n<th>First attack</th>\n<th>Last attack</th>\n</tr>\n</thead>\n<tbody>\n<tr>\n<td>DOS</td>\n<td>5,410</td>\n<td>2014</td>\n<td>2023</td>\n</tr>\n<tr>\n<td>Malware</td>\n<td>4,501</td>\n<td>2016</td>\n<td>2020</td>\n</tr>\n<tr>\n<td>Other</td>\n<td>950,000</td>\n<td>2014</td>\n<td>2023</td>\n</tr>\n</tbody>\n</table>\n<p>In simulations:</p>\n<p>Over 45 million DOS attacks</p>\n<p>Over 600 million</p>\n<p>Duties and purpose of the AI Interceptor:</p>\n<ul>\n<li>Protects the system from attacks</li>\n<li>Learn from your mistakes and successes</li>\n</ul>\n<p>If the attacker attacks more than 3 times,the AI interceptor is allowed to attack back.</p>\n<p>The system was later named AI SECURITY GROUP.</p>\n<p>After August 2023,not a single attack happened and the AI continued</p>\n<p>with simulations...</p>\n<p>P.S The first purpose of AI was defense against another entity. More precisely than AI or <strong>hypothetically</strong> some other Entity. Now there are over 250 uses...</p>\n<p>Subject:AI\n<br>\n\tStatus:Part II coming soon...<br>\nSubject name:AI - Eridu </p><br><br>\n<p><img src="https://api.eronelit.com/app&id=A03429468246&blog=10_dec_2023_11_45/1702118968197" alt="1702118968197"></p>\n\n<br><br><br>\nAI CUBE IMAGES <br><br>\n<p><img src="https://api.eronelit.com/app&id=A03429468246&blog=10_dec_2023_11_45/243434234141314135" alt="Preview Image"></p>\n<p><img src="https://api.eronelit.com/app&id=A03429468246&blog=10_dec_2023_11_45/423432423423423432" alt="Preview Image"></p>\n\n </div>\n</body>\n</html>\n\n <dnm_footer>Last modified:10.dec.2023 11:45AM</dnm_footer><style type=\'text/css\'>\n @import url(\'https://fonts.googleapis.com/css2?family=Mulish:ital,wght@0,200;0,300;0,400;0,500;0,600;0,700;0,800;0,900;1,200;1,300;1,400;1,500;1,600;1,700;1,800;1,900&display=swap\');\n @import url(\'https://fonts.googleapis.com/css2?family=Poppins:ital,wght@0,100;0,200;0,300;0,400;0,500;0,600;0,700;0,800;0,900;1,100;1,200;1,300;1,400;1,500;1,600;1,700;1,800;1,900&display=swap\');\n \n </style><script type=\'text/javascript\'> </script><div class="cursor " style="opacity:0;"></div>\n \n </div>',
