        thumbail:
          "https://api.eronelit.com/app&id=A03429468246&blog=23_okt_2023_13_22/1698063174900",
        gallery: [],
        shared_links: [],
        page: '<!DOCTYPE html>\n<html>\n<head>\n<title>23_okt_2023_13_22.md</title>\n<meta http-equiv="Content-type" content="text/html;charset=UTF-8">\n\n\n\n\n\n\n\n\n\n</head>\n<body>\n <div class="content-wrapper">\n <h1 id="ne%C5%A1to-razmiljam-%C5%A1ta-ako%3F-je-mogu%C4%87e..." tabindex="-1">Ne\u0161to razmiljam \u0161ta ako? Je mogu\u0107e...</h1>\n<p>Se\u0107ate li se Memorijskih kristala o kojim sam pisao i o mojoj tehnologiji koja mo\u017ee da promeni tehnologiju do te mere da ljudi misle da je nau\u010dna fantastika...</p>\n<p>Tehnologija koja CPU,SSD/HDD,RAM,Grafi\u010dka u jednom i gde mo\u017ee da pohrani ogromnu koli\u010dinu podataka pogledajte PDF...</p>\n<p>Me\u0111utim u simulaciji postoji jo\u0161 ne\u0161to:Ako obrnete polaritet kontrolnih magneta koji kontroli\u0161u protok bezi\u010dne struje izme\u0111u dva kristalna \u010dipa koja su razdvojena dva nanomilimetra...</p>\n<p>\u2026 mozak proizvodi neku vrstu magnetnog polja,obrtanje polariteta \u0107e jednostavno pokrenuti deo DNA i AI nesvesni program u mozgu koji je zaslu\u017ean da vam jednostavno zarastu rane,kao kod nekih vrsta gu\u0161tera ako nestane rep iz bilo kog razloga izra\u0161\u0107e novi...</p>\n<p>Zamisli:Izraste ti ponovo zub? Ne mora\u0161 nikada kod zubara,zamisli ima\u0161 veliku povredu koja je za dana\u0161nju tehnologiju jednostavno nemogu\u0107e da zaraste. Dok je uz tu tehnologiju mogu\u0107e i nikada vi\u0161e ne ode\u0161 kod doktora?</p>\n<ul>\n<li>\u010cekaj kako misli\u0161 AI Nesvesni program u mozgu?</li>\n</ul>\n<p>Ljudi imaju pristup svim procesima samo jedva 1%/2%,sve ostalo radi nesvesni deo koji je programiran preko DNA i koji se reprogramira po svesnom delu\u2026</p>\n<p>Postoje tehnologije sa kojima mo\u017eete putem misli da kontroli\u0161ete rakete,avione,ve\u0161ta\u010dke ruke... Ta tehnologija jednostavno postoji odavno.\nMe\u0111utim takve tehnologije mogu samo da \u010ditaju \u0161ta mozak radi ali ne i da upisuju. Sam AI nesvesni program ima sigurnosne mehanizme za blokadu signala koje on ne prepozna kao svoje i bri\u0161e ih. Jednostavno nemate Admin privilegije za taj program\u2026</p>\n<p>Kada bi se signali upisivali u AI nesvesni program,\u010dovek se nikada na primer nebi razboleo. Sada to pokre\u0107e novi problem:Ljudski mozak radi na 10-20% kapaciteta,Ljudi jednostavno nisu dovoljno evoulirali kao vrsta za tako ne\u0161to! Dok je tu tehnologija da pomogne i da zauzme tih 90/80%...</p>\n<p>Ljudi \u0107e mo\u017eda re\u0107i,\u010dekaj. Postoje \u0107elije,procesi,hemijski procesi nije sve nesvesni deo! Svi mi znamo da se du\u0161a razvija iz nekog DNA ili nekog drugog naprednijeg koda,kao \u0161to svest u AI ne mo\u017ee da se napravi samo da se razvije iz postoje\u0107ih podataka i koda.\nSada da li je du\u0161a do\u0161la od nekud to je ve\u0107 druga nauka\u2026</p>\n<p>Kada nau\u010di\u0161 ne\u0161to novo u mozgu se prave nove \u0107elije svaki put ali \u0161ta ih jednostavno tera da se stvaraju? Ovaj put program nas zanima a ne hemijski procesi koji su isto va\u017eni za rad mozga ili to pravilnije re\u010deno Neurolo\u0161kog sistema ...</p>\n<ul>\n<li>\u0160ta bi se desilo kada bi ljudi slu\u010dajno hipoteti\u010dki re\u010deno imali pristup nesvesnom delu?</li>\n</ul>\n<p>Ljudi su poznati po tome da su radoznali sigurno bi ne\u0161to istra\u017eivali...\nTo je izuzetno opasno. Zamisli slu\u010dajno poremeti\u0161 jednostavan proces disanja. Mozak bi poku\u0161ao prvo da resetuje DNA i ostale procese ...</p>\n<p>P.S Sada ostaje glavno pitanje:Za\u0161to mozak ne resetuje DNA do te mere da ljudi budu zdravi zauvek?\nEvolucija ili je zaklju\u010dano iz nekog dobrog razloga ...</p>\n<div class="embed_posts"> \n<p>Conected post <a class="a_icon bi bi-box-arrow-up-right" title="Open in new tab" href="/?p=blog&id=1695556499839" target="_blank"></a> </p>\n\n<iframe src="https://api.eronelit.com/app&id=A03429468246&blog=24_sept_2023_12_01" preload="none" height="825" width="504" frameborder="0" allowfullscreen="" title="Embedded post"></iframe>\n\n \n </div>\n\n\t<iframe src="/?pdf_file=view&id=23_okt_2023_13_22/1695559894716" preload="none" height="825" width="504" frameborder="0" allowfullscreen="" title="Embedded post"></iframe>\n</body>\n</html>\n\n <dnm_footer>Last modified:23.okt.2023 13:22AM</dnm_footer><style type=\'text/css\'>\n @import url(\'https://fonts.googleapis.com/css2?family=Mulish:ital,wght@0,200;0,300;0,400;0,500;0,600;0,700;0,800;0,900;1,200;1,300;1,400;1,500;1,600;1,700;1,800;1,900&display=swap\');\n @import url(\'https://fonts.googleapis.com/css2?family=Poppins:ital,wght@0,100;0,200;0,300;0,400;0,500;0,600;0,700;0,800;0,900;1,100;1,200;1,300;1,400;1,500;1,600;1,700;1,800;1,900&display=swap\');\n \n </style><script type=\'text/javascript\'> </script><div class="cursor " style="opacity:0;"></div>\n \n </div>',
